import React from "react";
import { useHistory } from "react-router-dom";

const HomePage = () => {
  const history = useHistory();

  return (
    <div>
      <h1>Welcome to the Invoice App</h1>
      <button onClick={() => history.push("/invoice-details")}>
        Invoice Details
      </button>
      <button onClick={() => history.push("/invoice-list")}>
        Invoice List
      </button>
    </div>
  );
};

export default HomePage;
